import React from 'react';
import { MemberCard } from './MemberCard.js';
import { EventGoalCard } from './EventGoalCard.js';
import '../../css/footer.css';


const Footer = () => {
  let totalMemberCards = 6;
  let totalEventCards = 6;
  let totalGoalCards = 6;
  let totalCards = totalMemberCards + totalEventCards + totalGoalCards;

  let memberCards = [...Array(totalMemberCards)].map((curr, index)=>{
    let randomLeft = Math.round((Math.random() * 10 - 5) + (index)*(100/6));
    let randomBottom = Math.round(Math.random() * 100);
    let randomZ = Math.round(Math.random() * totalCards);
    return (
      <MemberCard
        key={"memberCard" + index}
        left={randomLeft}
        bottom={randomBottom}
        z={randomZ}
      />
    )
  });

  return (
    <div>
      <EventGoalCard type="event" />
      <EventGoalCard type="event" />
      <EventGoalCard type="event" />
      <EventGoalCard type="goal" />
      <EventGoalCard type="goal" />
      <EventGoalCard type="goal" />
      {memberCards}
    </div>
  )
}

export default Footer;
